import React from 'react'

const Home = () => (
    <div style={{ display: 'flex', justifyContent: 'center', margin: 82 }} >
        <div className="team" style={{ padding: 80 }}></div>
        <style JSX>{`
                .team {
                background: url('`+ img + `');
                height: 100%;
                background-position: center;
                background-repeat: no-repeat;
                background-size: cover;
                }
                `}
        </style>
    </div>

)

export default Home;
